import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import '../styles/TestResults.css';

function TestResults() {
  const navigate = useNavigate();
  const { id } = useParams();

  const [showConfetti, setShowConfetti] = useState(true);
  const [percentileWidth, setPercentileWidth] = useState(0);

  // Test results data
  const resultsData = {
    overallScore: 7.5,
    maxScore: 9.0,
    percentile: 67,
    completedDate: 'November 7, 2025',
    skills: [
      {
        name: 'Listening',
        icon: 'headphones',
        color: 'purple',
        score: 8.0,
        maxScore: 9.0,
        stats: [
          { label: 'Correct Answers', value: '32 / 40' },
          { label: 'Time Taken', value: '28:30' },
          { label: 'Accuracy', value: '80%' }
        ],
        chart: [
          { section: 'Part 1', score: 9 },
          { section: 'Part 2', score: 8 },
          { section: 'Part 3', score: 7 },
          { section: 'Part 4', score: 8 }
        ]
      },
      {
        name: 'Reading',
        icon: 'book-open',
        color: 'blue',
        score: 7.5,
        maxScore: 9.0,
        stats: [
          { label: 'Correct Answers', value: '30 / 40' },
          { label: 'Time Taken', value: '52:15' }
        ],
        subScores: [
          { label: 'MCQ', value: '85%' },
          { label: 'T/F/NG', value: '70%' },
          { label: 'Matching', value: '80%' },
          { label: 'Summary', value: '75%' }
        ]
      },
      {
        name: 'Writing',
        icon: 'pen',
        color: 'amber',
        score: 7.0,
        maxScore: 9.0,
        subScores: [
          { label: 'Task Achievement', value: '7.0' },
          { label: 'Coherence', value: '7.5' },
          { label: 'Lexical Resource', value: '7.0' },
          { label: 'Grammar', value: '6.5' }
        ],
        comment: 'Good structure and clear arguments. Consider using more complex sentence structures and varied vocabulary for a higher score.'
      },
      {
        name: 'Speaking',
        icon: 'microphone',
        color: 'pink',
        score: 7.5,
        maxScore: 9.0,
        subScores: [
          { label: 'Fluency', value: '8.0' },
          { label: 'Vocabulary', value: '7.5' },
          { label: 'Grammar', value: '7.0' },
          { label: 'Pronunciation', value: '8.0' }
        ],
        hasAudio: true,
        audioProgress: 35
      }
    ],
    strengths: [
      {
        title: 'Strong listening comprehension',
        description: 'Excellent performance in identifying main ideas and specific details'
      },
      {
        title: 'Good vocabulary range in speaking',
        description: 'Used varied and appropriate vocabulary throughout the test'
      },
      {
        title: 'Clear pronunciation and fluency',
        description: 'Spoke confidently with minimal hesitation and good rhythm'
      },
      {
        title: 'Well-structured writing',
        description: 'Essays showed clear organization with proper paragraphing'
      }
    ],
    improvements: [
      {
        title: 'Complex sentence structures',
        description: 'Try using more compound and complex sentences in your writing'
      },
      {
        title: 'True/False/Not Given questions',
        description: 'Practice distinguishing between False and Not Given statements'
      },
      {
        title: 'Time management',
        description: 'Reading section took 8 minutes over optimal time. Practice pacing strategies'
      },
      {
        title: 'Grammatical accuracy',
        description: 'Focus on verb tenses and subject-verb agreement in speaking'
      }
    ],
    resources: [
      {
        icon: 'pen-fancy',
        title: 'Grammar for IELTS Writing',
        description: 'Master complex sentence structures and improve grammatical range for higher writing scores',
        color: 'amber'
      },
      {
        icon: 'list-check',
        title: 'True/False/Not Given Practice',
        description: 'Targeted exercises to help distinguish between false statements and not given information',
        color: 'blue'
      },
      {
        icon: 'clock',
        title: 'Time Management Tips',
        description: 'Learn strategies to pace yourself effectively and complete all sections within time limits',
        color: 'purple'
      }
    ],
    nextSteps: [
      {
        emoji: 'ðŸ“š',
        title: 'Personalized Learning Path',
        description: 'Get a customized study plan based on your performance'
      },
      {
        emoji: 'ðŸŽ¯',
        title: 'Practice Modules',
        description: 'Focus on specific skills that need improvement'
      },
      {
        emoji: 'ðŸ“…',
        title: 'Schedule Next Test',
        description: 'Book your next assessment in 2 weeks'
      },
      {
        emoji: 'ðŸ‘¥',
        title: 'Join Study Group',
        description: 'Connect with learners at your level'
      }
    ]
  };

  useEffect(() => {
    // Animate percentile bar
    setTimeout(() => {
      setPercentileWidth(resultsData.percentile);
    }, 500);

    // Hide confetti after 3 seconds
    setTimeout(() => {
      setShowConfetti(false);
    }, 3000);
  }, []);

  const getSkillColorClass = (color) => {
    const colorMap = {
      purple: '#8B5CF6',
      blue: '#3B82F6',
      amber: '#F59E0B',
      pink: '#EC4899'
    };
    return colorMap[color] || '#6B7280';
  };

  return (
    <div className="test-results-page">
      {/* Header */}
      <div className="header">
        <div className="logo">English Mastery</div>
        <div className="header-actions">
          <button className="header-btn" onClick={() => navigate('/dashboard')}>
            <i className="fas fa-home"></i>
            Dashboard
          </button>
          <button className="header-btn">
            <i className="fas fa-user-circle"></i>
            Profile
          </button>
        </div>
      </div>

      {/* Main Container */}
      <div className="main-container">
        {/* Hero Section */}
        <div className="hero-section">
          {showConfetti && (
            <div className="confetti-container">
              {Array(50).fill(0).map((_, i) => (
                <div
                  key={i}
                  className="confetti"
                  style={{
                    left: `${Math.random() * 100}%`,
                    backgroundColor: ['#8B5CF6', '#EC4899', '#3B82F6', '#F59E0B', '#10B981'][Math.floor(Math.random() * 5)],
                    animationDelay: `${Math.random() * 2}s`,
                    animationDuration: `${Math.random() * 2 + 2}s`
                  }}
                />
              ))}
            </div>
          )}

          <h1 className="hero-title">
            Test Complete
            <span className="celebration-emoji">ðŸŽ‰</span>
          </h1>
          <p className="hero-subtitle">
            Congratulations! You've completed all sections of your English proficiency test.
          </p>

          <div className="overall-score">
            <div className="score-label">Overall Score</div>
            <div className="score-value">{resultsData.overallScore}</div>
            <div className="score-max">/ {resultsData.maxScore}</div>
          </div>
        </div>

        {/* Score Breakdown */}
        <h2 className="section-title">
          <i className="fas fa-chart-bar"></i>
          Score Breakdown
        </h2>

        <div className="scores-grid">
          {resultsData.skills.map((skill, index) => (
            <div key={index} className={`skill-card ${skill.color}`}>
              <div className="skill-header">
                <div className="skill-name">
                  <div className="skill-icon" style={{ background: `linear-gradient(135deg, ${getSkillColorClass(skill.color)} 0%, ${getSkillColorClass(skill.color)}dd 100%)` }}>
                    <i className={`fas fa-${skill.icon}`}></i>
                  </div>
                  {skill.name}
                </div>
                <div className="skill-score">
                  {skill.score} <span className="max">/ {skill.maxScore}</span>
                </div>
              </div>

              {skill.stats && (
                <div className="skill-stats">
                  {skill.stats.map((stat, statIndex) => (
                    <div key={statIndex} className="stat-row">
                      <span className="stat-label">{stat.label}</span>
                      <span className="stat-value">{stat.value}</span>
                    </div>
                  ))}
                </div>
              )}

              {skill.subScores && (
                <div className="sub-scores">
                  {skill.subScores.map((subScore, subIndex) => (
                    <div key={subIndex} className="sub-score-item">
                      <div className="sub-score-label">{subScore.label}</div>
                      <div className="sub-score-value">{subScore.value}</div>
                    </div>
                  ))}
                </div>
              )}

              {skill.comment && (
                <div className="skill-comment">
                  <i className="fas fa-comment-dots"></i> {skill.comment}
                </div>
              )}

              {skill.hasAudio && (
                <div className="audio-playback">
                  <button className="play-mini-btn">
                    <i className="fas fa-play"></i>
                  </button>
                  <div className="audio-timeline">
                    <div className="audio-progress" style={{ width: `${skill.audioProgress}%` }}></div>
                  </div>
                  <span className="audio-time">2:15 / 6:30</span>
                </div>
              )}

              {skill.chart && (
                <div className="chart-container">
                  <svg width="100%" height="120" viewBox="0 0 280 120">
                    {skill.chart.map((item, i) => {
                      const barWidth = 50;
                      const barSpacing = 70;
                      const x = 30 + i * barSpacing;
                      const barHeight = (item.score / 9) * 80;
                      const y = 90 - barHeight;
                      
                      return (
                        <g key={i}>
                          <rect
                            x={x}
                            y={y}
                            width={barWidth}
                            height={barHeight}
                            fill={getSkillColorClass(skill.color)}
                            rx="4"
                          />
                          <text
                            x={x + barWidth / 2}
                            y="105"
                            textAnchor="middle"
                            fontSize="11"
                            fill="#6B7280"
                          >
                            {item.section}
                          </text>
                        </g>
                      );
                    })}
                  </svg>
                </div>
              )}
            </div>
          ))}
        </div>

        {/* Detailed Feedback */}
        <h2 className="section-title">
          <i className="fas fa-clipboard-check"></i>
          Detailed Feedback
        </h2>

        <div className="feedback-section">
          <div className="feedback-grid">
            <div className="feedback-column strengths">
              <h3>
                <i className="fas fa-check-circle"></i>
                Strengths
              </h3>
              <div className="feedback-list">
                {resultsData.strengths.map((item, index) => (
                  <div key={index} className="feedback-item strength">
                    <i className="fas fa-check-circle feedback-icon"></i>
                    <div className="feedback-text">
                      <strong>{item.title}</strong> - {item.description}
                    </div>
                  </div>
                ))}
              </div>
            </div>

            <div className="feedback-column improvements">
              <h3>
                <i className="fas fa-exclamation-triangle"></i>
                Areas for Improvement
              </h3>
              <div className="feedback-list">
                {resultsData.improvements.map((item, index) => (
                  <div key={index} className="feedback-item improvement">
                    <i className="fas fa-exclamation-triangle feedback-icon"></i>
                    <div className="feedback-text">
                      <strong>{item.title}</strong> - {item.description}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>

        {/* Comparison */}
        <div className="comparison-section">
          <div className="comparison-text">
            You scored better than <span className="highlight">{resultsData.percentile}%</span> of test-takers at your level
          </div>
          <div className="percentile-bar">
            <div 
              className="percentile-fill" 
              style={{ width: `${percentileWidth}%` }}
            >
              <div className="percentile-marker">ðŸ‘¤</div>
            </div>
          </div>
        </div>

        {/* Recommended Resources */}
        <h2 className="section-title">
          <i className="fas fa-book-reader"></i>
          Recommended Resources
        </h2>

        <div className="resources-grid">
          {resultsData.resources.map((resource, index) => (
            <div key={index} className="resource-card">
              <div 
                className="resource-icon"
                style={{ 
                  background: `linear-gradient(135deg, ${getSkillColorClass(resource.color)} 0%, ${getSkillColorClass(resource.color)}dd 100%)` 
                }}
              >
                <i className={`fas fa-${resource.icon}`}></i>
              </div>
              <div className="resource-title">{resource.title}</div>
              <div className="resource-desc">{resource.description}</div>
            </div>
          ))}
        </div>

        {/* Action Buttons */}
        <div className="actions-section">
          <button className="action-btn primary">
            <i className="fas fa-download"></i>
            Download Detailed Report
          </button>
          <button className="action-btn secondary" onClick={() => navigate(`/test/${id}`)}>
            <i className="fas fa-eye"></i>
            Review Answers
          </button>
          <button className="action-btn secondary" onClick={() => navigate(`/test/${id}/start`)}>
            <i className="fas fa-redo"></i>
            Retake Test
          </button>
          <button className="action-btn secondary">
            <i className="fas fa-dumbbell"></i>
            Practice Weak Areas
          </button>
          <button className="action-btn secondary">
            <i className="fas fa-share-alt"></i>
            Share Results
          </button>
        </div>

        {/* What's Next */}
        <div className="next-section">
          <h2 className="next-title">What's Next?</h2>
          <p className="next-subtitle">Continue your learning journey with personalized recommendations</p>

          <div className="next-grid">
            {resultsData.nextSteps.map((step, index) => (
              <div key={index} className="next-card">
                <div className="next-card-icon">{step.emoji}</div>
                <div className="next-card-title">{step.title}</div>
                <div className="next-card-desc">{step.description}</div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default TestResults;
